interface TimeLineData{
  dateTime :String;
  title : String;
  detail? : JSX.Element ; 
} 

function timeLineItem(data:TimeLineData):JSX.Element {

  let detail :JSX.Element =data.detail ?   <div className={styles.timeLineLink}>{data.detail}</div>:<div className={styles.timeLineLink}></div>;
 

  return(
     <TimelineItem >
       
          <TimelineSeparator>
            <TimelineDot variant="outlined" />
            <TimelineConnector />
          </TimelineSeparator>
         
            <br></br>
          <TimelineContent className={styles.timeLineBG}>
          <div className={styles.dateColor}>
            {data.dateTime}
            </div>
  <div className={styles.timeLineTitle}>
  {data.title}
    </div>          

 <br></br>
  {detail}
          </TimelineContent>
          </TimelineItem>
  );
}


 function ss():JSX.Element{
  return (
            
  
      <ul className={`${tl.timeline} ${tl.timeline_centered}`}>

          <li className={tl.timeline_item}>
              <div className={tl.timeline_info}>
                  <span>April 02, 2016</span>
              </div>
              <div className={tl.timeline_marker}></div>
              <div className={tl.timeline_content}>
                  <h3 className={tl.timeline_title}>Event Title</h3>
                  <p>Nullam vel sem. Nullam vel sem. Integer ante arcu, accumsan a, consectetuer eget, posuere ut, mauris. Donec orci lectus, aliquam ut, faucibus non, euismod id, nulla. Donec vitae sapien ut libero venenatis faucibus. ullam dictum felis
                      eu pede mollis pretium. Pellentesque ut neque. </p>
              </div>
          </li>
          <li className={tl.timeline_item}>
              <div className={tl.timeline_info}>
                  <span>April 28, 2016</span>
              </div>
              <div className={tl.timeline_marker}></div>
              <div className={tl.timeline_content}>
                  <h3 className={tl.timeline_title}>Event Title</h3>
                  <p>Nullam vel sem. Nullam vel sem. Integer ante arcu, accumsan a, consectetuer eget, posuere ut, mauris. Donec orci lectus, aliquam ut, faucibus non, euismod id, nulla. Donec vitae sapien ut libero venenatis faucibus. ullam dictum felis
                      eu pede mollis pretium. Pellentesque ut neque. </p>
              </div>
          </li>
      </ul>
 );
}


function TimeLineItem(data:TimeLineData):JSX.Element {

  let detail :JSX.Element =data.detail ?   <div className={styles.timeLineLink}>{data.detail}</div>:<div className={styles.timeLineLink}></div>;
 

  return(
    <li className={tl.timeline_item}>
    <div className={tl.timeline_info}>
        <span>{data.dateTime}</span>
    </div>
    <div className={tl.timeline_marker}></div>
    <div className={tl.timeline_content}>
        <h3 className={tl.timeline_title}>{data.title}</h3>
        <p>Nullam vel sem. Nullam vel sem. Integer ante arcu, accumsan a, consectetuer eget, posuere ut, mauris. Donec orci lectus, aliquam ut, faucibus non, euismod id, nulla. Donec vitae sapien ut libero venenatis faucibus. ullam dictum felis
            eu pede mollis pretium. Pellentesque ut neque. </p>
    </div>
</li>
  );
}

 
export default function TimeLine() {
  
  const timeLine = <Timeline align="left" className={styles.timeLine}>
  {timeLinesItems.map(timeLineItem)};
 
 </Timeline>
  return (
<motion.div initial="pageInitial" animate="pageAnimate" variants={{
  pageInitial: {
    opacity: 0
  },
  pageAnimate: {
    opacity: 1
  },
  
}}>
<div className={styles.work}>
<h2>Experiences</h2>
      
<ul className={`${tl.timeline}${styles.timeline}`}>

{timeLinesItems.map(TimeLineItem)}


</ul>
     
      </div>
      
      <div className={styles.skills}>

<h2>Education and Skills</h2>
<h3>Education and Courses</h3>
      <h4>Python, Javascript/Typescript, Dart, C, Java, R</h4>
      <h4>Python, Javascript/Typescript, Dart, C, Java, R</h4>
      <br></br>
      <h3>Programming Languages</h3>
      <h4>Python, Javascript/Typescript, Dart, C, Java, R</h4>
      <br></br>
      <h3>Industry Skills</h3>
      <h4><img src={"./icons/next-js.svg"} ></img>Next.js</h4>
      
      <h4><img src={"./icons/Flutter.svg"} ></img>Flutter</h4>
      <h4><img src={"./icons/android.svg"} ></img>Android</h4>
      </div>
    
     
</motion.div>

  );
}
